import { Avatar } from '@mui/material';
import React, { Component } from 'react';

import "./Mainpage.css"
class ImageLayout extends Component {
    constructor(props) {
        super(props);
    }
    state = {  }
    render() { 
        return (
            <div className='imagelayout_container'>
                <div className='imagelayout_image'>
                    <Avatar className='img' src='https://scontent.fbho4-3.fna.fbcdn.net/v/t1.6435-1/120015140_319554869348445_1586273488652125233_n.jpg?stp=cp0_dst-jpg_p80x80&_nc_cat=104&ccb=1-7&_nc_sid=dbb9e7&_nc_ohc=XG4umKxzgn4AX9718dg&_nc_ht=scontent.fbho4-3.fna&oh=00_AT843KhqYsCCrjYSjpOHDefMd_JAk1zcpLFpAn9E99G7vQ&oe=62FD4FC2'/>
                </div>
                <div className='imagelayout_text'>
                    Aakash Kumar
                </div>
            </div>
         );
    }
}
 
export default ImageLayout;
